import Navigation from "../Navigation/Navigation"
import Footer from "../Footer/Footer";
import TableList from "../TableList/TableList"
import { Container } from 'react-bootstrap';

const Home = () => {
  <>
    <Navigation />
    <Container>
      <TableList />
    </Container>
    <Footer />
  </>
}

export default Home;
